tables.table_schema:
CREATE TABLE reports_dashboard_data (
    report_id INT PRIMARY KEY,
    report_name STRING,
    report_data JSONB,
    creation_date TIMESTAMP
);

CREATE TABLE Reports (
    report_id INT PRIMARY KEY,
    report_name VARCHAR(50),
    report_date DATE,
    report_data JSON
);

CREATE TABLE Dashboards (
    dashboard_id INT PRIMARY KEY,
    dashboard_name VARCHAR(50),
    dashboard_owner VARCHAR(50),
    dashboard_layout JSON
);
